import React, { Fragment } from "react";
import MainNavigation from "../components/MainNavigation";
import { Outlet } from "react-router-dom";

const Root = () => {
  return (
    <Fragment>
      <main>
        <MainNavigation />
      </main>
      <Outlet />
    </Fragment>
  );
};

export default Root;
